import React, { Component } from 'react'
import { Link } from 'react-router-dom'

const Portfolio = () => {
    return (
        <div className="container">
            <h4 className="center">About</h4>
            <p>Within the field of literary criticism, "text" also refers to the original information content of a particular piece of writing; that is, the "text" of a work is that primal symbolic arrangement of letters as originally composed, apart from later alterations, deterioration, commentary, translations, paratext, etc. Therefore, when literary criticism is concerned with the determination of a "text", it is concerned with the distinguishing of the original information content from whatever has been added to or subtracted from that content as it appears in a given textual document (that is, a physical representation of text). </p>    
        </div>
    )
}


export default Portfolio
